//액션 타입 정의

const ADD_STARTDATE = "DateRangePicker/ADD_STARTDATE";

//액션 생성 함수 정의

export const addStartDate = start => {
  return {
    type: ADD_STARTDATE,
    payload: start
  };
};

// 초기값 설정
const INITIAL_STATE = "";

// 리듀서

export default function startReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case ADD_STARTDATE:
      return action.payload;
    default:
      return state;
  }
}
